window.bookSummaryJSON = "<p><b>Cold cases are about to get hot. Don’t miss this exhilarating crime thriller—perfect for fans of Criminal Minds and </b><b><i>A Good Girl’s Guide to Murder</i></b><b>—from Jennifer Lynn Barnes, the #1 </b><b><i>New York Times </i></b><b>bestselling</b><b><i> </i></b><b>author of </b><b><i>The Inheritance Games</i></b><b>.</b></p> <p>Seventeen-year-old Cassie is a natural at reading people. Piecing together the tiniest details, she can tell you who you are and what you want. But, it's not a skill that she's ever taken seriously. That is, until the FBI come knocking: they've begun a classified program that uses exceptional teenagers to crack infamous cold cases, and they need Cassie.</p> <p>What Cassie doesn't realize is that there's more at risk than a few unsolved homicides—especially when she's sent to live with a group of teens whose gifts are as unusual as her own. Soon, it becomes clear that no one in the Naturals program is what they seem. And when a new killer strikes, danger looms close. Caught in a lethal game of cat and mouse with a killer, the Naturals are going to have to use all of their gifts just to survive.</p> <p>Think <i>The Mentalist</i> meets <i>Pretty Little Liars</i>—Jennifer Lynn Barnes's <i>The Naturals</i> is a gripping psychological thriller with killer appeal, a to-die-for romance, and the bones of a gritty and compelling new series.</p> <p><b>Praise for </b><b><i>The Naturals</i></b><br> <br> \"<i>The Naturals</i> is <i>Criminal Minds</i> for the YA world, and I loved every page.\"—<i>New York Times</i> best-selling author Ally Carter</p> <p>* \"[A] tightly paced suspense novel that will keep readers up until the wee hours to finish.\"—<i>VOYA</i> (starred review)</p> <p>\"This savvy thriller grabs readers right away.\"—<i>Kirkus Reviews</i></p> <p>\"It's a stay-up-late-to-finish kind of book, and it doesn't disappoint.\"—<i>Publishers Weekly</i></p> <p>\"In this high-adrenaline series opener...even a psychic won't anticipate all the twists and turns.\"—<i>Booklist</i></p>"; 
